import { defineNuxtModule, createResolver } from '@nuxt/kit'
import { get } from 'https'
import unzipper from 'unzipper'


const RFG_ENDPOINT = 'https://realfavicongenerator.net/api/favicon'
const RFG_KEY = '1d339536c98db47d71da9d952c85fd6df2fe9eeb'

export default defineNuxtModule({
  meta: {
    name: 'favicon',
    configKey: 'favicon'
  },
  // Default configuration options of the Nuxt module
  defaults: {},
  setup (options, nuxt) { // options, nuxt
    const resolver = createResolver(import.meta.url)

    nuxt.hook('build:before', async () => {

      const image = ``


      // TODO get image from static file
      // TODO turn image into base64
      // TODO check favicon does not exist
      // TODO add params force to overwrite existing favicon
      // TODO move favicon.ico to public directory
      // TODO add log, loading to let know the users of what is happening

      // Fetch api post options
      options = {
        favicon_generation: {
          api_key: RFG_KEY,
          files_location: {
            type: "path",
            path: "/icons"
          },
          force: false,
          master_picture: {
            type: "inline",
            content: image,
          },
          ...options,
        }
      }
      const result = await fetch(RFG_ENDPOINT, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json;charset=utf-8'
        },
        body: JSON.stringify(options)
      })
        .then(response => response.json())
        .catch(error => {
          console.warn(error)
          return error
        })

      // Unzip files to public folder
      if (result?.favicon_generation_result?.result?.status === 'success') {

        // TODO set metas data for favicons from html
        // const htmlMeta = result?.favicon_generation_result?.favicon?.html_code || null

        const urlZip = result?.favicon_generation_result?.favicon?.package_url || null

        if (urlZip) {
          get(urlZip, (response) => {
            response.pipe(unzipper.Extract({ path: resolver.resolve('../../../public/icons') }))
          })
        }
      }



    })


  }
})
